+// trim white spaces from front and end of string.
+char* trim(char* s) {
+  assert(s != NULL && strlen(s) > 0, "Must not be NULL");
+  while(isspace(*s)) s++;
+  char* i = s + strlen(s);
+  while(isspace(*--i));
+  *(i+1) = '\0';
+  return s;
+}
